import './App.css';
import { useState } from 'react';
import React from 'react';
// import cookiepng from './Cookie.png';

function App() {
  const [score, setscore] = useState(0);

  function increment() {
    setscore(score + 1);
  }

  return (
    <div className="Cookie">
      <button onClick={() => increment()} size="md">Cookie </button>
      <h1>Cookies: {score} </h1>
    </div>
  );
}

export default App;
